import "./Heroimage2Styles.css"

import React from 'react'

const Heroimage2 = () => {
  return (
    <div className="hero-img">
        <div className="heading">
            <h1>This is heading</h1>
            <p>This is paragraph</p>
        </div>
    </div>
  )
}

export default Heroimage2
